                "description": {
                  "runs": [
                    {
                      "text": "5 years have passed and my piano arrangement of unravel has reached 70 Million views already. Ever since then, the name Animenz has been often associated with \"that unravel cover guy\" on the internet and to be honest, until today I am still surprised why this particular video has exploded in popularity (笑)　\n\nBack then, this piano arrangement were just one among many anime piano cover videos I was uploading during my Conservatory years in Germany. There were many different piano covers of unravel on YouTube already but most of them were only covering the TV-size version, not the full song. \n\nAt that time, I was practicing many technically difficult classical pieces (Chopin, Liszt and Rachmaninoff, among many others) and this might explain the extreme difficulty level of this piano arrangement, compared to my usual arrangements. It is basically full with very risky jumps and super fast arpeggios. Especially the particular \"guitar riff\" arpeggio at "
                    },
                    {
                      "text": "02:21",
                      "navigationEndpoint": {
                        "clickTrackingParams": "CMsBEM2rARgBIhMIkJSJieK18QIVRC1MCh1Nsw0x",
                        "commandMetadata": {
                          "webCommandMetadata": {
                            "url": "/watch?v=sEQf5lcnj_o&list=RD_AzeUSL9lZc&index=1&t=141s",
                            "webPageType": "WEB_PAGE_TYPE_WATCH",
                            "rootVe": 3832
                          }
                        },
                        "watchEndpoint": {
                          "videoId": "sEQf5lcnj_o",
                          "playlistId": "RD_AzeUSL9lZc",
                          "index": 0,
                          "continuePlayback": true,
                          "startTimeSeconds": 141,
                          "watchEndpointSupportedOnesieConfig": {
                            "html5PlaybackOnesieConfig": {
                              "commonConfig": {
                                "url": "https://r3---sn-hgn7yn7s.googlevideo.com/initplayback?source=youtube&orc=1&oeis=1&c=WEB&oad=3200&ovd=3200&oaad=11000&oavd=11000&ocs=700&oewis=1&oputc=1&ofpcc=1&msp=1&odeak=1&odepv=1&osfc=1&ip=109.208.48.228&id=b0441fe657278ffa&osts=141&initcwndbps=913750&mt=1624726124&oweuc="
                              }
                            }
                          }
                        }
                      }
                    },
                    {
                      "text": " is probably the fastest arpeggio I have ever attempted.\n\nIt easily belongs to my top 3 most difficult transcriptions I ever made, among \"My Dearest\" and \"Kuusou Mesorogiwi\" and I doubt I will ever make something as frustratingly difficult as this again. To master this piece you need a very good left hand and right hand coordination. There are many complicated rhythms in this piece and the only way to properly memorize them all is by repeatedly practicing it again and again in half speed.\n\nEspecially the octave melody in "
                    },
                    {
                      "text": "00:35",
                      "navigationEndpoint": {
                        "clickTrackingParams": "CMsBEM2rARgBIhMIkJSJieK18QIVRC1MCh1Nsw0x",
                        "commandMetadata": {
                          "webCommandMetadata": {
                            "url": "/watch?v=sEQf5lcnj_o&list=RD_AzeUSL9lZc&index=1&t=35s",
                            "webPageType": "WEB_PAGE_TYPE_WATCH",
                            "rootVe": 3832
                          }
                        },
                        "watchEndpoint": {
                          "videoId": "sEQf5lcnj_o",
                          "playlistId": "RD_AzeUSL9lZc",
                          "index": 0,
                          "continuePlayback": true,
                          "startTimeSeconds": 35,
                          "watchEndpointSupportedOnesieConfig": {
                            "html5PlaybackOnesieConfig": {
                              "commonConfig": {
                                "url": "https://r3---sn-hgn7yn7s.googlevideo.com/initplayback?source=youtube&orc=1&oeis=1&c=WEB&oad=3200&ovd=3200&oaad=11000&oavd=11000&ocs=700&oewis=1&oputc=1&ofpcc=1&msp=1&odeak=1&odepv=1&osfc=1&ip=109.208.48.228&id=b0441fe657278ffa&osts=35&initcwndbps=913750&mt=1624726124&oweuc="
                              }
                            }
                          }
                        }
                      }
                    },
                    {
                      "text": " is often called \"THE WALL\", because most people just give up practicing the song at this point. Even today, I make occasional mistakes when playing this part, because you have to do huge jumps with both of your hands at the same time. Since I can only focus on one hand only at each time, the other hand have to manage the jump completely blindly by sheer muscle memory alone. It is indeed frustrating to learn and I am seriously wondering myself, how I even managed to play this entire song in only one continuous take back then.\n\nIn hindsight, if I would arrange this song again, I would use my gained experience from the past five years to make it less frustrating to play, but without losing its musical quality. And I would definitely avoid using those cursed double hand jumps in "
                    },
                    {
                      "text": "00:35",
                      "navigationEndpoint": {
                        "clickTrackingParams": "CMsBEM2rARgBIhMIkJSJieK18QIVRC1MCh1Nsw0x",
                        "commandMetadata": {
                          "webCommandMetadata": {
                            "url": "/watch?v=sEQf5lcnj_o&list=RD_AzeUSL9lZc&index=1&t=35s",
                            "webPageType": "WEB_PAGE_TYPE_WATCH",
